import React from "react";
import { useContext } from "react";
import { filterContext } from "./VoiceChatBot";
import DisplayIpData from "./DisplayIpData";

function FilteredIp() {
  const filterData = useContext(filterContext);
  console.log("log ", filterData);

  return (
    <div className="cards-list-wrapper">
      {Object.entries(filterData).map((data, i) => (
        <DisplayIpData key={i} data={data[1]} ip={data[0]} />
      ))}
    </div>
  );
}

export default FilteredIp;
